If you have two outputs, you'd do something like this:

    OrtValue *output_values[2]; // Array of 2 pointers
    status = OrtRun( ... same as you listed until...., 2 /* number of outputs */, output_values);

Saying just 'outputs' in the parameter to OrtRun passes the address of the array of two pointers, which is of type OrtValue**.

Or using std::vector

    std::vector<OrtValue*> output_values(2, nullptr);
    status = OrtRun( ...same as above... output_values.size(), output_values.data());

In both the above example and the std::vector one, to iterate is easy. There are multiple options, but this is probably easy to understand (though I wouldn't hardcode the 2 in the loop, it's just for the example):

    for(int i=0;i<2;i++)
      // Do something with output_values[i]

I recommend using the C++ wrapper API since it simplifies the pointer work you'd have to do.

